```python
from itertools import combinations

def find_subset_of_length_n(set_of_elements):
    return len(list(combinations(set_of_elements, 96)))
```
Please note that this code may take a long time or even crash due to memory issues if the size of your set is too large. This is because the combinations generator has a time complexity of O(n!) and space complexity of O(k), where n is the size of the input set and k is the size of the combinations you're generating (in this case 96).
